INSERT INTO `business_notice` VALUES (1,'[사업공지] 외부감사인 선임 공고','<p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: &quot;Noto Sans&quot;, &quot;Noto Sans KR&quot;, sans-serif; letter-spacing: -0.32px; white-space-collapse: preserve-breaks;\">당사는 주식회사 등의 외부감사에 관한 법률 제12조 제1항 및 동법 시행령 제18조 제1항의 규정에 의거하여 외부감사인 선임사실을 다음과 같이 공고합니다.&nbsp;</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: &quot;Noto Sans&quot;, &quot;Noto Sans KR&quot;, sans-serif; letter-spacing: -0.32px; white-space-collapse: preserve-breaks;\">&nbsp;</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: &quot;Noto Sans&quot;, &quot;Noto Sans KR&quot;, sans-serif; letter-spacing: -0.32px; white-space-collapse: preserve-breaks;\">-&nbsp;외부감사인 : 삼정회계법인</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: &quot;Noto Sans&quot;, &quot;Noto Sans KR&quot;, sans-serif; letter-spacing: -0.32px; white-space-collapse: preserve-breaks;\">- 감사대상기간 : 2022년 1월 1일부터 2024년 12월 31일까지(3개년)&nbsp;</p>','2024-01-15 09:22:33'),(2,'[사업공지] 주식명의개서 정지 공고','<p><span style=\"color: rgb(35, 35, 36); font-family: &quot;Noto Sans&quot;, &quot;Noto Sans KR&quot;, sans-serif; letter-spacing: -0.32px; white-space-collapse: preserve-breaks;\">상법 제354조 및 당사 정관 제13조의 규정에 의거 2022년 6월 24일 현재 주주명부에 기재되어 있는 주주에게 의결권을 부여하며, 권리 주주 확정을 위하여 2022년 6월 25일부터 2022년 7월 8일까지 주식의 명의개서, 질권의 등록 및 말소, 신탁재산의 표시 및 말소 등의 주주명부의 기재사항 변경을 정지하오니 양지하시기 바랍니다.</span><br></p>','2024-01-15 09:23:11'),(3,'[공지] 혼밥싫어 직원 / 협력사 사칭 피해 주의 안내','<p><span style=\"color: rgb(54, 54, 54); font-family: Ubuntu, Kakao, &quot;Apple SD Gothic Neo&quot;, &quot;Malgun Gothic&quot;, &quot;Nanum Gothic&quot;, &quot;Noto Sans&quot;, &quot;sans-serif&quot;; font-size: 18px;\">안녕하세요.</span></p><p style=\