INSERT INTO `notice` VALUES (1,'[공지] 공지사항입니다.','<p>오늘 13:00 ~ 14:00시에 서버 점검이 있을 예정이니 참고 바랍니다.</p>','2024-01-15 09:21:47'),(2,'[공지] 오늘의 메뉴 추천입니다.','<p><br></p><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"18b563e785edecd.jpg\" style=\"background-color: var(--bs-body-bg); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); width: 590px;\"></div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;BBQ 서울대점에서 매콤달콤한 양념치킨이 할인행사 이벤트를 진행합니다!</div><div style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;많은 이용 부탁드립니다.</div><p></p>','2024-01-15 09:31:07'),(3,'[공지] 개인정보처리방침 일부 변경에 관한 안내','<p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">안녕하세요.&nbsp;</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">주식회사 혼밥싫어의 개인정보처리방침을 일부 변경하게 되어 이를 알려드리고자 합니다</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">&nbsp;</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">■&nbsp;개정 사유</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">- 개인정보의 추가적인 이용 또는 제공, 처리위탁 현행화\r\n- 개인정보의 안전성 확보 조치 제목 및 내용 수정</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">- 개인정보보호책임자 담당부서 현행화</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">&nbsp;</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">■ 개정&nbsp;일자</p><p style=\"border: 0px solid; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; color: rgb(35, 35, 36); font-family: \" noto=\"\" sans\",=\"\" \"noto=\"\" sans=\"\" kr\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" -0.32px;=\"\" white-space-collapse:=\"\" preserve-breaks;\"=\"\">- 공고 일자: 2024년 01월 15일(수)\r\n- 시행 일자: 2024년 01월 16일(목)</p>','2024-01-15 09:21:58');
